	public ArrayList<Integer> findSubstring(String S, String[] L) {
        // Start typing your Java solution below
        // DO NOT write main() function
        // we will recursion to solve this problem
        // find the first match of one of the substrings
        // find the next match of one of the remaining substrings from the starting position
        // stop if any of unmatches or all substring get matched
		// the complexity is O(|S|\sum{|Li|})
        // check the input first
        ArrayList<Integer> result=new ArrayList<Integer>();
        if (S==null || L==null || L.length<1)
        {
            return result;
        }
        // main algorithm: try each location one by one in DFS
        boolean []remaining=new boolean[L.length];
        Arrays.fill(remaining, true);
        for (int i=0; i<S.length(); i++)
        {
        	for (int j=0; j<L.length; j++)
        	{
        		Arrays.fill(remaining, true);
        		remaining[j]=false;
	            if (findSubstring(S, i, j, L, remaining))
	            {
	                result.add(i);
	                break;
	            }
        	}
        }
        return result;
    }
    
    /*
    * this function finds the match of the remaining substring at the S, with specificed starting location
    * @param S the searched string
    * @param start the starting location
    * @param target the current substring to be searched
    * @param L the list of substring
    * @param remaining the flag of remaining strings.
    */
    private boolean findSubstring(String S, int start, int target, String []L, boolean []remaining)
    {
        // check whether the current target is a match
        if (!(L[target]==null || L[target].length()<1 || (S.length()-start>=L[target].length() && L[target].equals(S.substring(start, L[target].length()+start)))))
        {
            return false; 
        }
        boolean flag=true;
        int i;
        // check whether we alraady found a full match
        for (i=0; i<remaining.length; i++)
        {
            if (remaining[i])
            {
                flag=false;
            }
        }
        // every substring in the list has been observed
        if (flag)
        {
            return true;
        }
        // otherwise, we search for next remaining string in the list
        for (i=0; i<remaining.length; i++)
        {
            if (remaining[i])
            {
                // we try [i] first
                remaining[i]=false;
                if (findSubstring(S, start+L[target].length(), i, L, remaining))
                {
                    return true;
                }
                remaining[i]=true;
            }
        }
        // there is no possible match there given previous condition
        return false;
    }
    
    public ArrayList<Integer> findSubstringFast(String S, String[] L) {
        // Start typing your Java solution below
        // DO NOT write main() function
        // we use a hashmap to store the list of substring for a quick string match
        // to deal with duplicated substrings in the list, we store the frequence of 
        // the substring as the value, where as the substring itself is the key
        ArrayList<Integer> result=new ArrayList<Integer>();
        if (S==null || L==null || L.length<1)
        {
            return result;
        }
        // buildup the hashmap
        HashMap<String, Integer> table=new HashMap<String, Integer>();
        for (String word: L)
        {
            addWord(table, word);
        }
        // apply the search recursively
        int word_length=L[0].length();
        int total_length=word_length*L.length;
        for (int i=0; i<=S.length()-total_length; i++)
        {
            // create a duplicatiton
            HashMap<String, Integer> count=new HashMap<String, Integer>(table);
            for (int j=0; j<L.length; j++)
            {
                // find the match in each of string
                if (!removeWord(count, S.substring(i+j*word_length, i+j*word_length+word_length)))
                {
                    break;
                }
            }
            // we find the match
            if (count.isEmpty())
            {
                result.add(i);
            }
        }
        return result;
    }
    
    private void addWord(HashMap<String, Integer> table, String word)
    {
        if (table.containsKey(word))
        {
            table.put(word, table.get(word)+1);
        }
        else
        {
            table.put(word, 1);
        }
    }
    
    private boolean removeWord(HashMap<String, Integer> table, String word)
    {
        if (table.containsKey(word))
        {
            if (table.get(word)>1)
            {
                table.put(word, table.get(word)-1);
            }
            else
            {
                table.remove(word);
            }
            return true;
        }
        else
        {
            return false;
        }
    }
